import React from 'react';
import './App.css';
import Infograph from './components/Infograph/infograph';
import MyBio from './components/Story/story';
import Test from './components/Test/test'
import NavBar from './components/Nav/nav'
import GetAPIDataForCity from './components/Parks and weather/parks'

//const AppLayout = styled.div
function App() {
  return (
    <div className='app'
>
      <NavBar />
      <MyBio className='bio' />
      <Infograph className='chart' />
      <Test className='form'/>
      <GetAPIDataForCity />

    </div>
  );
}

export default App;
